import React, { useState, useEffect } from 'react';
import { initializeApp } from 'firebase/app';
import Table from 'react-bootstrap/Table';

// Initialize Firebase

const SearchDelete = () => {
  const [data, setData] = useState([]);


  return (
    <Table striped bordered hover>
    <thead>
      <tr>
        <th>ID</th>
        <th>NAME</th>
        <th>AGE</th>
      </tr>
    </thead>
    <tbody>
    {
      data.map((row) =>(
        <tr key={row.ID}>
        <td>{row.ID}</td>
        <td>{row.Name}</td>
        <td>{row.age}</td>
        <td><button type="button" onClick={() => deleteDataById(row.ID)} className="btn btn-danger">Delete</button>
</td>
      </tr>

    ))}
    </tbody>
  </Table>

  );
};

export default SearchDelete;
